Circuits in ARK-PLONK depend on two generic parameters: The pairing engine which is a pairing friendly curve used for pairing operations and proof verification Twisted Edwards curve: derived from the first one and is used to make elliptic curve operations inside of the circuit. Example: pub struct TestCircuit< E: PairingEngine, P: TEModelParameters<BaseField = E::Fr>,
> { a: E::Fr, b: E::Fr, c: E::Fr, d: E::Fr, e: P::ScalarField, f: GroupAffine<P>,
} Currently tests are only run with two pairing friendly curves Bls12_381 and Bls12_377 in order to check that the library is generic and can in fact work correctly with different parameters and also to measure performance when changing the used curve. Commitment scheme: The first implementation of ARK-PLONK used the KZG10 commitment scheme which needs a trusted setup as explained in the KZG10 section. However, in order for other projects who don’t wish to have a trusted setup like Mithril for example there is a generic implementation using ark-poly-commit library. Signature scheme: TBD Hash function: TBD
